  `title` varchar(200) NOT NULL COMMENT 'house name',
  `content` text COMMENT 'description',
  `city` varchar(100) NOT NULL COMMENT 'city',
  `address` varchar(200) DEFAULT NULL COMMENT 'address',
  `thumbnail_url` varchar(200) DEFAULT NULL COMMENT 'thumbnail',
  `slide_url` varchar(1000) DEFAULT NULL COMMENT 'Carousel',
  `month_rent` int(11) NOT NULL COMMENT 'monthly rent',
  `status` int(4) NOT NULL DEFAULT '1' COMMENT '0Not leased，1Leased out，,-1Removed,-2Pending review，-3Vetting not approved',
  `certificate_no` varchar(50) DEFAULT NULL COMMENT 'certificate_no',
