  `direction` varchar(20) DEFAULT NULL COMMENT 'house direction',
  `last_order_start_time` datetime DEFAULT NULL COMMENT 'last_order_start_time',
  `last_order_end_time` datetime DEFAULT NULL COMMENT 'last_order_end_time',
