  `customer_user_id` bigint(20) NOT NULL COMMENT 'tenant id',
  `owner_user_id` bigint(20) NOT NULL COMMENT 'landlord id',
  `status` int(4) NOT NULL COMMENT 'Order Status：-2Agreement pending confirmation，-1Payment pending，0 in force, 1 expired, -3 tenant cancelled',
  `house_id` bigint(20) NOT NULL COMMENT 'house id',
  `month_rent` int(11) NOT NULL COMMENT 'month rent',
  `day_num` int(11) NOT NULL COMMENT 'Rental days',
  `total_amount` int(11) NOT NULL COMMENT 'Total amount',
  `start_date` datetime DEFAULT NULL COMMENT 'Start date',
  `end_date` datetime DEFAULT NULL COMMENT 'End date',
  PRIMARY KEY (`id`),
  KEY `owner_user_id` (`owner_user_id`) USING BTREE,
  KEY `customer_user_id` (`customer_user_id`) USING BTREE,
  KEY `create_time` (`create_time`) USING BTREE,
  KEY `house_id` (`house_id`),
  CONSTRAINT `t_order_ibfk_1` FOREIGN KEY (`owner_user_id`) REFERENCES `t_user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `t_order_ibfk_2` FOREIGN KEY (`customer_user_id`) REFERENCES `t_user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `t_order_ibfk_3` FOREIGN KEY (`house_id`) REFERENCES `t_house` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8;

