/*Table structure for table `t_user` */

DROP TABLE IF EXISTS `t_user`;

CREATE TABLE `t_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'Primary Key',
  `create_time` datetime NOT NULL COMMENT 'Registration time',
  `user_name` varchar(30) NOT NULL COMMENT 'username',
  `user_display_name` varchar(30) NOT NULL COMMENT '姓名',
  `phone` varchar(20) NOT NULL COMMENT 'phone number',
  `email` varchar(30) NOT NULL COMMENT 'email',
  `user_pass` varchar(100) NOT NULL COMMENT 'password',
  `id_card` varchar(30) DEFAULT NULL COMMENT 'id card',
  `user_avatar` varchar(100) DEFAULT NULL COMMENT 'avatar/profile picture',
  `user_desc` varchar(200) DEFAULT NULL COMMENT 'Personal Description',
  `status` int(4) NOT NULL DEFAULT '0' COMMENT 'Status: 0 normal, 1 disabled',
  `role` varchar(20) NOT NULL COMMENT 'Role, admin/landlord/tenant',
  `gender` varchar(20) DEFAULT NULL COMMENT 'Gender',
  `budget` varchar(10) DEFAULT NULL COMMENT 'monthly budget',
  `nationality` varchar(20) DEFAULT NULL COMMENT 'nationality',
  `wantcity` varchar(20) DEFAULT NULL COMMENT 'the city that you want to live in',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_name` (`user_name`) USING BTREE,
  KEY `create_time` (`create_time`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1123 DEFAULT CHARSET=utf8;

